import { CoreConstants } from '@/core/constants';
import { Component, OnInit } from '@angular/core';
import { FAQ_QRCODE_INFO_DONE, ONBOARDING_DONE } from '@features/login/constants';
import { CoreSettingsHelper } from '@features/settings/services/settings-helper';
import { CoreSitePlugins } from '@features/siteplugins/services/siteplugins';
import { CoreUserTours } from '@features/usertours/services/user-tours';
import { CoreCacheManager } from '@services/cache-manager';
import { CoreConfig } from '@services/config';
import { CoreFile } from '@services/file';
import { CoreNavigator } from '@services/navigator';
import { CorePlatform } from '@services/platform';
import { CoreSites } from '@services/sites';
import { CoreDomUtils, ToastDuration } from '@services/utils/dom';
import { CoreUtils } from '@services/utils/utils';

/**
 * Page that displays the developer options.
 */
@Component({
    selector: 'page-core-app-settings-dev',
    templateUrl: 'dev.html',
})
export class CoreSettingsDevPage implements OnInit {

    rtl = false;
    forceSafeAreaMargins = false;
    direction = 'ltr';

    remoteStyles = true;
    remoteStylesCount = 0;
    pluginStyles = true;
    pluginStylesCount = 0;
    sitePlugins: CoreSitePluginsBasicInfo[] = [];
    userToursEnabled = true;
    stagingSitesCount = 0;
    enableStagingSites?: boolean;
    previousEnableStagingSites?: boolean;

    disabledFeatures: string[] = [];

    siteId: string | undefined;

    async ngOnInit(): Promise<void> {
        this.rtl = CorePlatform.isRTL;
        this.RTLChanged();

        this.forceSafeAreaMargins = document.documentElement.classList.contains('force-safe-area-margins');
        this.safeAreaChanged();

        this.siteId = CoreSites.getCurrentSite()?.getId();

        this.stagingSitesCount = CoreConstants.CONFIG.sites.filter((site) => site.staging).length;

        if (this.stagingSitesCount) {
            this.enableStagingSites = await CoreSettingsHelper.hasEnabledStagingSites();
            this.previousEnableStagingSites = this.enableStagingSites;
        }

        if (!this.siteId) {
            return;
        }

        this.remoteStyles = false;
        this.remoteStylesCount = 0;

        this.pluginStyles = false;
        this.pluginStylesCount = 0;

        this.userToursEnabled = !CoreUserTours.isDisabled();

        document.head.querySelectorAll('style').forEach((style) => {
            if (this.siteId && style.id.endsWith(this.siteId)) {
                if (style.innerHTML.length > 0) {
                    this.remoteStylesCount++;
                }
                this.remoteStyles = this.remoteStyles || style.getAttribute('media') != 'disabled';
            }

            if (style.id.startsWith('siteplugin-')) {
                if (style.innerHTML.length > 0) {
                    this.pluginStylesCount++;
                }
                this.pluginStyles = this.pluginStyles || style.getAttribute('media') != 'disabled';
            }
        });

        this.sitePlugins = CoreSitePlugins.getCurrentSitePluginList().map((plugin) => ({
            addon: plugin.addon,
            component: plugin.component,
            version: plugin.version,
        }));

        const disabledFeatures = (await CoreSites.getCurrentSite()?.getPublicConfig())?.tool_mobile_disabledfeatures;

        this.disabledFeatures = disabledFeatures?.split(',').filter(feature => feature.trim().length > 0) ?? [];
    }

    /**
     * Called when the rtl is enabled or disabled.
     */
    RTLChanged(): void {
        this.direction = this.rtl ? 'rtl' : 'ltr';
        document.dir = this.direction;
    }

    /**
     * Called when safe area margins is enabled or disabled.
     */
    safeAreaChanged(): void {
        document.documentElement.classList.toggle('force-safe-area-margins', this.forceSafeAreaMargins);
    }

    /**
     * Called when remote styles is enabled or disabled.
     */
    remoteStylesChanged(): void {
        document.head.querySelectorAll('style').forEach((style) => {
            if (this.siteId && style.id.endsWith(this.siteId)) {
                if (this.remoteStyles) {
                    style.removeAttribute('media');
                } else {
                    style.setAttribute('media', 'disabled');
                }
            }
        });
    }

    /**
     * Called when remote styles is enabled or disabled.
     */
    pluginStylesChanged(): void {
        document.head.querySelectorAll('style').forEach((style) => {
            if (style.id.startsWith('siteplugin-')) {
                if (this.pluginStyles) {
                    style.removeAttribute('media');
                } else {
                    style.setAttribute('media', 'disabled');
                }
            }
        });
    }

    /**
     * Open error log.
     */
    openErrorLog(): void {
        CoreNavigator.navigate('error-log');
    }

    /**
     * Copies site info.
     */
    copyInfo(): void {
        CoreUtils.copyToClipboard(JSON.stringify({ disabledFeatures: this.disabledFeatures, sitePlugins: this.sitePlugins }));
    }

    /**
     * Reset all user tours.
     */
    async resetUserTours(): Promise<void> {
        await CoreUserTours.resetTours();

        await CoreConfig.delete(ONBOARDING_DONE);
        await CoreConfig.delete(FAQ_QRCODE_INFO_DONE);

        CoreDomUtils.showToast('User tours have been reseted');
    }

    /**
     * Invalidate app caches.
     */
    async invalidateCaches(): Promise<void> {
        const success = await CoreDomUtils.showOperationModals('Invalidating caches', true, async () => {
            await CoreCacheManager.invalidate();

            return true;
        });

        if (!success) {
            return;
        }

        await CoreDomUtils.showToast('Caches invalidated', true, ToastDuration.LONG);
    }

    /**
     * Delete all data from the app.
     */
    async clearFileStorage(): Promise<void> {
        const sites = await CoreSites.getSitesIds();
        await CoreFile.clearDeletedSitesFolder(sites);
        await CoreFile.clearTmpFolder();

        CoreDomUtils.showToast('File storage cleared');
    }

    async setEnabledStagingSites(enabled: boolean): Promise<void> {
        if (this.enableStagingSites === this.previousEnableStagingSites) {
            return;
        }

        try {
            await CoreSettingsHelper.setEnabledStagingSites(enabled);
            this.previousEnableStagingSites = enabled;
        } catch (error) {
            this.enableStagingSites = !enabled;
            CoreDomUtils.showErrorModal(error);
        }
    }

}

// Basic site plugin info.
type CoreSitePluginsBasicInfo = {
    component: string;
    addon: string;
    version: string;
};
<ion-header>
    <ion-toolbar>
        <ion-buttons slot="start">
            <ion-back-button [text]="'core.back' | translate" />
        </ion-buttons>

        <ion-title>
            <h1>{{ 'core.settings.developeroptions' | translate }}</h1>
        </ion-title>

        <ion-buttons slot="end" *ngIf="siteId">
            <ion-button fill="clear" (click)="copyInfo()" [attr.aria-label]="'core.settings.copyinfo' | translate">
                <ion-icon slot="icon-only" name="fas-clipboard" aria-hidden="true" />
            </ion-button>
        </ion-buttons>
    </ion-toolbar>
</ion-header>
<ion-content>
    <ion-list class="list-item-limited-width">
        <ion-item class="ion-text-wrap">
            <ion-label>
                <p class="item-heading">Change text direction</p>
                <p>{{ direction }}</p>
            </ion-label>
            <ion-toggle [(ngModel)]="rtl" (ionChange)="RTLChanged()" slot="end" />
        </ion-item>
        <ion-item class="ion-text-wrap">
            <ion-label>
                <p class="item-heading">Force safe area margins</p>
            </ion-label>
            <ion-toggle [(ngModel)]="forceSafeAreaMargins" (ionChange)="safeAreaChanged()" slot="end" />
        </ion-item>
        <ion-item class="ion-text-wrap" *ngIf="stagingSitesCount && enableStagingSites !== undefined">
            <ion-label>
                <h2>Enable staging sites ({{stagingSitesCount}})</h2>
            </ion-label>
            <ion-toggle [(ngModel)]="enableStagingSites" (ionChange)="setEnabledStagingSites($event.detail.checked)" slot="end" />

        </ion-item>
        <ng-container *ngIf="siteId">
            <ion-item class="ion-text-wrap">
                <ion-label>
                    <p class="item-heading">Enable remote styles <ion-badge>{{remoteStylesCount}}</ion-badge>
                    </p>
                </ion-label>
                <ion-toggle [(ngModel)]="remoteStyles" (ionChange)="remoteStylesChanged()" slot="end" />
            </ion-item>
            <ion-item class="ion-text-wrap">
                <ion-label>
                    <p class="item-heading">Enable site plugin styles <ion-badge>{{pluginStylesCount}}</ion-badge>
                    </p>
                </ion-label>
                <ion-toggle [(ngModel)]="pluginStyles" (ionChange)="pluginStylesChanged()" slot="end" />
            </ion-item>
        </ng-container>

        <ion-item class="ion-text-wrap" *ngIf="userToursEnabled">
            <ion-label>
                <p class="item-heading">Reset user tours</p>
            </ion-label>
            <ion-button (click)="resetUserTours()" aria-label="Reset user tours" fill="clear" slot="end">
                <ion-icon slot="icon-only" aria-hidden="true" name="fas-repeat" />
            </ion-button>
        </ion-item>

        <ion-item class="ion-text-wrap">
            <ion-label>
                <p class="item-heading">Invalidate caches</p>
            </ion-label>
            <ion-button (click)="invalidateCaches()" aria-label="Invalidate caches" fill="clear" slot="end">
                <ion-icon slot="icon-only" aria-hidden="true" name="fas-rotate-right" />
            </ion-button>
        </ion-item>

        <ion-item class="ion-text-wrap" (click)="openErrorLog()" [detail]="true" button>
            <ion-label>
                <p class="item-heading">Error log</p>
            </ion-label>
        </ion-item>

        <ion-item class="ion-text-wrap">
            <ion-label>
                <p class="item-heading">Clean file storage</p>
                <p>Clear deleted sites from file storage and temp folder</p>
            </ion-label>
            <ion-button (click)="clearFileStorage()" aria-label="Clear File Storage" fill="clear" slot="end">
                <ion-icon slot="icon-only" aria-hidden="true" name="fas-broom" />
            </ion-button>
        </ion-item>

        <ng-container *ngIf="siteId">
            <ion-item-divider>
                <ion-label>
                    <h2>Disabled features</h2>
                </ion-label>
            </ion-item-divider>
            <ion-item *ngIf="disabledFeatures.length === 0">
                <ion-label>There are no features disabled</ion-label>
            </ion-item>
            <ion-item class="ion-text-wrap" *ngFor="let feature of disabledFeatures">
                <ion-label>
                    <p class="item-heading">{{ feature }}</p>
                </ion-label>
            </ion-item>

            <ion-item-divider>
                <ion-label>
                    <h2>Site plugins</h2>
                </ion-label>
            </ion-item-divider>
            <ion-item *ngIf="sitePlugins.length === 0">
                <ion-label>There are no site plugins installed</ion-label>
            </ion-item>
            <ion-item class="ion-text-wrap" *ngFor="let plugin of sitePlugins">
                <ion-label>
                    <p class="item-heading">{{ plugin.addon }} ({{plugin.component}})</p>
                    <p>{{plugin.version}}</p>
                </ion-label>
            </ion-item>
        </ng-container>
    </ion-list>
</ion-content>
